import './App.css';
import HelloWorld from './components/HelloWorld' 
import SayMyName from './components/SayMyName'

function App() {
  const name = 'Maria'
return (
    <div className="App">
         <HelloWorld/>
         <SayMyName name=" Matheus"/>
         <SayMyName name=" João"/>
         <SayMyName name=" João"/>
     </div> 
  );

}

export default App;
